       {this.setState( function (prevState) { return { Conteur: prevState.Conteur + 1 }; })}
    }
render(){
    return(
        <div>
            <p>les nombre est : {Conteur}</p>
            <button onClick={this.Changenote}>Changer</button>
        </div>
    )
}
}
